#include <math.h>
#include <stdbool.h>
#include <stdint.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define AUDIO_BASE 0xFF203040 //Microphone
#define SWITCH_BASE 0xFF200040 //Switches 
#define LED_BASE 0xFF200000 //LEDS
#define TIMER_BASE 0xFF202000 //Timer
#define PIXEL_SIZE 4
#define PS2_BASE ((volatile int *)0xFF200100)  // PS/2 keyboard

// For double buffering
#define FRONT_BUFFER_ADDR 0xC8000000
#define BACK_BUFFER_ADDR 0xC0000000

/////////////////////////////////////////////////////////////////////////
///////////////////////////// DATA STRUCTURES ///////////////////////////
/////////////////////////////////////////////////////////////////////////

// Item Data Structure
typedef struct {
  int x, y;       // Position
  char name[20];  // Name
  int status;     // Status (0 = not collected, 1 = collected)
} Item;

// User Data Structure
typedef struct {
  int x, y;              // Position
  int delta_x, delta_y;  // Velocity
  char name[20];         // Name
} User;

// Monster Data Structure
typedef struct {
  double x, y;              // Position
  double delta_x, delta_y;  // Velocity
} Monster;

struct audio_t {
  volatile unsigned int control;  // control/status register
  volatile unsigned char rarc;    // right input fifo
  volatile unsigned char ralc;    // left input fifo
  volatile unsigned char wsrc;    // right output fifo
  volatile unsigned char wslc;    // left output fifo
  volatile unsigned int ldata;    // left input/output fifo
  volatile unsigned int rdata;    // right input/output fifo
};

//////////////////////////////////////////////////////////////////////////
///////////////////////////// GLOBAL VARIABLES ///////////////////////////
//////////////////////////////////////////////////////////////////////////

extern short unsigned int titlescreen[76800];
extern short unsigned int gameoverscreen[76800];
extern short unsigned int monster[700];
extern short unsigned int coin[90];
extern short unsigned int user[225];

volatile int *pixel_ctrl_ptr = (int *)0xFF203020;  // VGA controller
volatile int *key_ptr = (int *)0xFF200050;         // Key control register
volatile int *audio_ptr = (int *)AUDIO_BASE;       // Audio peripheral
volatile int *switch_ptr = (int *)SWITCH_BASE;     // Switches
volatile int *led_ptr = (int *)LED_BASE;           // LEDs
volatile int *timer_ptr = (int *)TIMER_BASE;       // Timer registers
short int color = 0xFFFF;                          // noise bar color

//key states and bytes
static bool w_down = false;
static bool a_down = false;
static bool s_down = false;
static bool d_down = false;
static char byte1 = 0;
static char byte2 = 0;
static char byte3 = 0;
int cntrlBuffer;
int score = 0; 
//editable set of user coordinates to configure vision range
int userCenterX = 0;
int userCenterY = 0;
static unsigned short backBuffer[320 * 240]; //Offscreen buffer

/////////////////////////////////////////////////////////////////////////
///////////////////////////// FUNCTION PROTOTYPES ///////////////////////
/////////////////////////////////////////////////////////////////////////
void generateItems(Item items[], int size);
int generateRandom(int max, int min);
void clearScreen();
void plotPixel(int x, int y, short int line_color);
bool monsterProximity(User user, Monster monster, int noise);
void drawNoiseBar(int x, int y, short int color, int noise);
void plotDigit(int x, int y, int digit, short color);
void plotTimer(int x, int y, int number, short int color);
void plotTitlescreen(int x, int y);
void plotGameoverscreen(int x, int y);
void plotMonster(int x, int y);
void plotCoin(int x, int y);
void plotUser(int x, int y);
void delay(int cycles);
bool inVisualRange(int x, int y);
void writeBackBuffer(User user, Monster monster, Item items[], int noise,
                   int remainingSeconds);
void frontBufferFrame(void);
void wait_for_vsync();

/////////////////////////////////////////////////////////////////////////
///////////////////////////// MAIN //////////////////////////////////////
/////////////////////////////////////////////////////////////////////////

int main() {
  // Read location of the pixel buffer from the pixel buffer controller
  cntrlBuffer = *pixel_ctrl_ptr;
  struct audio_t *const audiop = (struct audio_t *)AUDIO_BASE; //pointer for audio

  //Setting up entities
  Item items[15];
  Monster monster;
  User user;
  generateItems(items, 15); //generate all items with unique coords

  // Initial positions

  //user
  user.x = 160;
  user.y = 120;

  //monster
  monster.x = 30;
  monster.y = 50;

  //monster speed and random movement configs
  int monsterDistance = 0;
  double monsterYDir = 0;
  double monsterXDir = 0;
  monster.delta_x = 3;
  monster.delta_y = 3;

  //audio processing configs
  int noise = 0;
  int sample;
  int sum = 0;
  int count = 0;

  // Game states
  int gameState = 0;
  int gameStateTitle = 0;
  int gameStateRun = 1;
  int gameStateOver = 2;
  int gameStateRestart = 3;

  // Timer variables
  int remainingSeconds = 200;
  int timerReady = 0;

  // Reset PS/2 keyboard
  *PS2_BASE = 0xFF;

  while (1) {

    int switch_value = *switch_ptr;  // Read switch states

////////////////////////////////////////////////////////////////////////////
///////////////////////////// TITLE SCREEN /////////////////////////////////
////////////////////////////////////////////////////////////////////////////

    if (gameState == gameStateTitle) {
      // Plot title screen
      plotTitlescreen(0, 0);
      wait_for_vsync();
      delay(100000);
      FrontBufferFrame();

      //check for keyboard input. 
      int ps2_data = *PS2_BASE;
      if (ps2_data & 0x8000) {
        byte1 = byte2;
        byte2 = byte3;
        byte3 = ps2_data & 0xFF;
      }

      if (byte2 != 0xF0 && byte3 == 0x29) {  // If spacebar pressed
        // Transition from title screen to game start state
        // set up timer
        *(timer_ptr + 1) = 0; 
        timerReady = 0;
        remainingSeconds = 200;
        *led_ptr = 0;  // Turn off LED0
        // reset keyboard state
        byte1 = 0;
        byte2 = 0;
        byte3 = 0;
        //set game state
        gameState = gameStateRun;
        //switch screen
        clearScreen();
        wait_for_vsync();
        delay(100000);  // Extra delay to ensure completed frame swapping
        FrontBufferFrame();
      }

////////////////////////////////////////////////////////////////////////
///////////////////////////// GAME RUN /////////////////////////////////
////////////////////////////////////////////////////////////////////////

    } else if (gameState == gameStateRun) {
      
      // INITIALIZE TIMER. (1 second)
      if (!timerReady) {
        *(timer_ptr + 2) = 100000000 & 0xFFFF;  // Lower 16 bits
        *(timer_ptr + 3) = 100000000 >> 16;     // Upper 16 bits
        *(timer_ptr + 1) =
            0x7;  // Start timer in continuous mode with interrupts
        timerReady = 1;
        remainingSeconds = 200;
      }


      // PROCESS KEYBOARD INPUT
      {
        int ps2_data = *PS2_BASE;
        if (ps2_data & 0x8000) {
          byte1 = byte2;
          byte2 = byte3;
          byte3 = ps2_data & 0xFF;
          if (byte2 == 0xF0) {  // Key released
            if (byte3 == 0x1D)
              w_down = false;
            else if (byte3 == 0x1B)
              s_down = false;
            else if (byte3 == 0x1C)
              a_down = false;
            else if (byte3 == 0x23)
              d_down = false;
          } else {  // Key pressed
            if (byte3 == 0x1D)
              w_down = true;
            else if (byte3 == 0x1B)
              s_down = true;
            else if (byte3 == 0x1C)
              a_down = true;
            else if (byte3 == 0x23)
              d_down = true;
          }
        }
      }

      // User movement logic:
      if (w_down) user.y -= PIXEL_SIZE;
      if (s_down) user.y += PIXEL_SIZE;
      if (a_down) user.x -= PIXEL_SIZE;
      if (d_down) user.x += PIXEL_SIZE;
      // Keep user within screen bounds
      if (user.x < 0) user.x = 0;
      if (user.x > 319 - PIXEL_SIZE) user.x = 319 - PIXEL_SIZE;
      if (user.y < 0) user.y = 0;
      if (user.y > 239 - PIXEL_SIZE) user.y = 239 - PIXEL_SIZE;
      
      //MONSTER MOVEMENT
      if (monsterDistance <= 0) {
        //Generate random direction
        int direction = generateRandom(4, 1);
        //Generate random distance to go in that direction
        monsterDistance = generateRandom(135, 5);
        monsterYDir = 0;
        monsterXDir = 0;
        //Set direction
        if (direction == 1) {  // up
          monsterYDir = monster.delta_y;
        } else if (direction == 2) {  // down
          monsterYDir = -monster.delta_y;
        } else if (direction == 3) {  // left
          monsterXDir = -monster.delta_x;
        } else if (direction == 4) {  // right
          monsterXDir = monster.delta_x;
        }
      }
      //If distance hasnt been travelled fully yet
      //decrement distance and skip direction/distance reset
      monsterDistance -= 1;
      monster.y += monsterYDir; //Move monster
      monster.x += monsterXDir;

      // Keep monster within screen bounds
      if (monster.x < 10) {
        monster.x = 10;
        monsterDistance = 0;
      }
      if (monster.x > 310 - monster.delta_x) {
        monster.x = 310 - monster.delta_x;
        monsterDistance = 0;
      }
      if (monster.y < 10) {
        monster.y = 10;
        monsterDistance = 0;
      }
      if (monster.y > 230 - monster.delta_y) {
        monster.y = 230 - monster.delta_y;
        monsterDistance = 0;
      }

      //PROCESSING AUDIO
      sum = 0;
      count = 0;
      while (((*(audio_ptr + 1)) & 0xFF) > 0 && count < 16) {
        sample = *(audio_ptr + 2);  // read left channel sample
        sample = abs(sample - 0x8000);
        sum += sample;
        count++;
      }

      if (count > 0){
        noise = sum / count; //total noise = average noise level
      }else{
        noise = 0;
      }

      //Noise threshold conditions
      if (noise > 110000000) {  
        for (int i = 0; i < 15; i++) { //search through items
          if (items[i].status == 0) { //If item unclaimed
            //Find distance between user and item
            int dx = abs(user.x - items[i].x);
            int dy = abs(user.y - items[i].y);
            //If distance is close is enough then remove item
            if ((dx <= 10 && dy <= PIXEL_SIZE) ||
                (dy <= 10 && dx <= PIXEL_SIZE)) {
              items[i].status = 1;  // Mark item as collected
              items[i].x = 500; //Make items disappear
              items[i].y = 500;
              score++;  //Increment score
            }
          }
        }
      }
    
      //GAME OVER CONDITIONS
      //If user is too loud and near monster, GAME OVER
      if (monsterProximity(user, monster, noise)) {
        remainingSeconds = 0; //Reset timer
        *(timer_ptr + 1) = 0;
        gameState = gameStateOver; //Game over state
      }
      // If all items have been collected, end the game
      if (score == 15) {
        remainingSeconds = 0; //Reset timer
        *(timer_ptr + 1) = 0;
        gameState = gameStateOver; //Game over state
      }

      // CHECKING TIMER
      if (*(timer_ptr) & 0x1) {
        *(timer_ptr) = 0;  // Clear timer flag
        *led_ptr ^= 0x1;   // Toggle LED0
        remainingSeconds--;
        if (remainingSeconds <= 0) {
          gameState = gameStateOver;
          *(timer_ptr + 1) = 0;  // Stop timer
        }
      }

      //VISUAL CONFIG

      //Find center of user sprite to simulate light later on
      userCenterX = user.x + 7;
      userCenterY = user.y + 7;

      //If noise above threshold, change noise bar color.
      if (noise > 110000000) {
        color = 0xF800;
      } else {
        color = 0xFFFF;
      }
      //write into back buffer
      writeBackBuffer(user, monster, items, noise, remainingSeconds);

      //Print frame
      wait_for_vsync();
      delay(100000);
      FrontBufferFrame();

////////////////////////////////////////////////////////////////////////
///////////////////////////// GAME RESTART /////////////////////////////
////////////////////////////////////////////////////////////////////////

    } else if (gameState == gameStateRestart) {
      // Reset all variables
      generateItems(items, 15);
      user.x = 160;
      user.y = 120;  // Center position
      monster.x = 30;
      monster.y = 50;
      monsterDistance = 0;
      monsterYDir = 0;
      monsterXDir = 0;
      monster.delta_x = 3;
      monster.delta_y = 3;
      noise = 0;
      score = 0;
      // Reset key state variables
      w_down = false;
      a_down = false;
      s_down = false;
      d_down = false;
      byte1 = 0;
      byte2 = 0;
      byte3 = 0;
      //reset timer
      timerReady = 0;
      *led_ptr = 0;  // Turn off LED0
      //immedietly go to game run state
      gameState = gameStateRun;
      //print screen
      clearScreen();
      wait_for_vsync();
      delay(100000);
      FrontBufferFrame();

////////////////////////////////////////////////////////////////////////
///////////////////////////// GAME OVER ////////////////////////////////
////////////////////////////////////////////////////////////////////////

    } else if (gameState == gameStateOver) {
      //Game over screen
      plotGameoverscreen(0, 0);

      //Print final score in the center of the screen
      
        const char* message; //Create message
        //If collected all items, you win, if not, you lose
        if (score == 15) {
          message = "YOU WIN. SCORE: ";
        } else {
          message = "YOU LOST. SCORE: ";
        }
        //find center of screen
        int centerX = (320 - (strlen(message) * 6)) / 2;
        int centerY = (240 - 7) / 2;
        //print text
        for (int i = 0; message[i] != '\0'; i++) {
        drawCharacter(centerX, centerY, message[i], 0xFFFF);
        centerX = centerX + 6;
        }

        int scoreDigits[2];
        scoreDigits[0] = score / 10;
        scoreDigits[1] = score % 10;
        for (int i = 0; i < 2; i++) {
          plotDigit(centerX, centerY, scoreDigits[i], 0xFFFF);
          centerX += 6;
        }

      

      wait_for_vsync();
      delay(100000);
      FrontBufferFrame();

      //Reset timer
      if (timerReady) {
        *(timer_ptr + 1) = 0;
        timerReady = 0;
      }

      //reset keyboard
      byte1 = 0;
      byte2 = 0;
      byte3 = 0;

      //Wait for full spacebar press-and-release
      while (1) {
        int ps2_data = *PS2_BASE;
        if (ps2_data & 0x8000) {
          byte1 = byte2;
          byte2 = byte3;
          byte3 = ps2_data & 0xFF;
        }
        if (byte2 != 0xF0 && byte3 == 0x29) {
          // Wait until key is released
          while ((*PS2_BASE & 0x8000) != 0) {
            delay(5000);
          }
          break; //when spacebar released, move forward
        }
      }

      gameState = gameStateRestart; //reset game in restart state
      clearScreen();
      wait_for_vsync();
      delay(100000);
      FrontBufferFrame();

      // Reset keyboard again to stop inputs leaking into game run
      w_down = false;
      a_down = false;
      s_down = false;
      d_down = false;
      byte1 = 0;
      byte2 = 0;
      byte3 = 0;
    }
  }

////////////////////////////////////////////////////////////////////////
///////////////////////////// END OF MAIN //////////////////////////////
////////////////////////////////////////////////////////////////////////

  return 0;
}


