///////////////////////////// FUNCTIONS ////////////////////////////////
////////////////////////////////////////////////////////////////////////

void writeBackBuffer(User user, Monster monster, Item items[], int noise,
                   int remainingSeconds) {
  //Fill back buffer with dark room background (lighting effect)
  for (int y = 0; y < 240; y++) {
    for (int x = 0; x < 320; x++) {
      if (inVisualRange(x, y)){
        backBuffer[y * 320 + x] = 0x4208;  //Gray inside radius
      }
      else{
        backBuffer[y * 320 + x] = 0x0000;  //Black outside radius
      }
    }
  }
  //Draw game assets
  //Logic for inVisualRange is embedded in functions
  plotUser(user.x, user.y);
  for (int i = 0; i < 15; i++) {
    plotCoin(items[i].x, items[i].y);
  }
  plotMonster(monster.x, monster.y);
  drawNoiseBar(0, 240, color, noise);
  plotTimer(270, 5, remainingSeconds, 0xFFFF);
}

//Copy back buffer to front buffer
void FrontBufferFrame(void) {
  for (int y = 0; y < 240; y++) {
    volatile short int *vga_row =
        (volatile short int *)(cntrlBuffer + (y << 10));
    for (int x = 0; x < 320; x++) {
      vga_row[x] = backBuffer[y * 320 + x];
    }
  }
}

void wait_for_vsync() {
  *pixel_ctrl_ptr = 1;
  while ((*pixel_ctrl_ptr & 0x01) != 0);
  cntrlBuffer = *(pixel_ctrl_ptr + 1);
}

bool inVisualRange(int x, int y) {
  int dx = x - userCenterX;
  int dy = y - userCenterY;
  //Circle radius of 40 pixels
  if((dx * dx + dy * dy) <= (40 * 40)){
    return true;
  }else{
    return false;
  }
}

//Generate random coordinates for all items and set status to 0
void generateItems(Item items[], int size) {
  for (int i = 0; i < size; i++) {
    items[i].x = generateRandom(300, 20);  // Random x coordinate
    items[i].y = generateRandom(210, 20);  // Random y coordinate
    items[i].status = 0;                   // Unclaimed
  }
}

//Random number generator
int generateRandom(int max, int min) { return rand() % (max - min + 1) + min; }

void clearScreen() {
  for (int y = 0; y < 240; y++) {
    for (int x = 0; x < 320; x++) {
      backBuffer[y * 320 + x] = 0x4208;
    }
  }
}

void plotPixel(int x, int y, short int line_color) {
  if ((x < 0) || (x >= 320) || (y < 0) || (y >= 240)){
    return;
  }
  backBuffer[y * 320 + x] = line_color;
}

void drawNoiseBar(int x, int y, short int color, int noise) {
  int max = noise / 1000000;
  for (int pos = 239; (239 - pos) < max; pos--) {
    for (int i = 0; i < PIXEL_SIZE; i++) {
      for (int j = 0; j < PIXEL_SIZE; j++) {
        int px = x + i;
        int py = pos + j;
        if (px >= 0 && px < 320 && py >= 0 && py < 240)
          plotPixel(px, py, color);
      }
    }
  }
}

void delay(int cycles) {
  volatile int i;
  for (i = 0; i < cycles; i++);
}

bool monsterProximity(User user, Monster monster, int noise) {
  int dx = monster.x - user.x;
  int dy = monster.y - user.y;
  double proximity = sqrt(dx * dx + dy * dy);
  if((noise > 110000000) && (proximity < 40)){
    return true;
  }else{
    return false;
  }
}

