//This is a 2D array bitmap to describe the designs of digits 0-9.
//Generative AI was used to generate font designs used in this array.


void plotDigit(int x, int y, int digit, short color) {
  const char** digitFont = digits[digit];
  for (int r = 0; r < 7; r++) {
    for (int c = 0; c < 5; c++) {
      if (digitFont[r][c] == '1')
        plotPixel(x + c, y + r, color);
    }
  }
}


void plotTimer(int x, int y, int number, short int color) {
  int digits[10];
  int count = 0;
  int p = x;
  while (number > 0) {
    digits[count] = number % 10;
    number /= 10;
    count = count + 1;
  }
  if (count == 0) {
    digits[0] = 0;
    count = 1;
  }
  for (int i = count - 1; i >= 0; i--) {
    plotDigit(p, y, digits[i], color);
    p += 6;
  }
}




